import React from 'react'
import { animated, useSpring } from 'react-spring';


const Information =()=>{

    const members = [
        {
            name: 'Abhay Nepal',
            roll: '075 BEI 003'
        },{
            name: 'Gokarna Adhikari',
            roll: '075 BEI 014'
        },{
            name: 'Kshitiz Dhakal',
            roll: '075 BEI 015'
        },{
            name: 'Love Panta',
            roll: '075 BEI 016'
        }
    ]
    const names = members.map(
        (i)=>{
            return(
                <tr>
                    <td>{i.name}</td>
                    <td>{i.roll}</td>
                </tr>
            )
        }
    )

    return(
        <animated.div
            style={
                {
                    loop:true
                }
            }
        >
            <h1>DBMS Project</h1>
            <hr />
            <h3 style={{textAlign:'left'}}>Completed By</h3>
            <hr />
            <table className='table table-dark'>
                <thead>
                    <tr>
                        <th>Name</th>
                        <th>Roll Number</th>
                    </tr>
                </thead>
                <tbody>
                    {names}
                </tbody>
            </table>
        </animated.div>
    )
}

export default Information;
